This is the famous logo of the most popular host club in Akihabara, Cyber Host Club. Cyber Host Club is so popular that there are customers who fight each other in order to attain the mail address of the No.1 super handsome host, Ouji. Akari, an Ouji fan, has fallen in love with the kind Ouji at first sight. In order to become closer to him, Akari must use her computer. But she is horrible with technology, especially computers. But good thing for Akari, she finds an Akiba otaku, Touma, who is good with computers. She'll have him teach her how to use the computer... but... why does he look like someone Akari knows?

